// frontend/src/components/Admin/Dashboard.js
import React, { useState, useEffect, useCallback } from 'react';
import { getAdminDashboard } from '../../api';

const Dashboard = () => {
  const [dashboardData, setDashboardData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  const fetchDashboardData = useCallback(async () => {
    try {
      setLoading(true);
      const response = await getAdminDashboard();
      setDashboardData(response.data);
      setError('');
    } catch (error) {
      console.error('Error fetching dashboard:', error);
      setError('Failed to fetch dashboard data');
    } finally {
      setLoading(false);
    }
  }, []);

  useEffect(() => {
    fetchDashboardData();
  }, [fetchDashboardData]); // ✅ Fixed dependency

  if (loading) return <div>Loading dashboard...</div>;
  if (error) return <div>Error: {error}</div>;

  return (
    <div>
      <h2>Admin Dashboard</h2>
      {dashboardData ? (
        <div>
          <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))', gap: '20px' }}>
            <div style={{ backgroundColor: '#f8f9fa', padding: '20px', borderRadius: '8px' }}>
              <h3>Total Members</h3>
              <p style={{ fontSize: '24px', fontWeight: 'bold' }}>{dashboardData.totalMembers || 0}</p>
            </div>
            <div style={{ backgroundColor: '#f8f9fa', padding: '20px', borderRadius: '8px' }}>
              <h3>Total Revenue</h3>
              <p style={{ fontSize: '24px', fontWeight: 'bold' }}>Rp {dashboardData.totalRevenue?.toLocaleString() || 0}</p>
            </div>
            <div style={{ backgroundColor: '#f8f9fa', padding: '20px', borderRadius: '8px' }}>
              <h3>Pending Payments</h3>
              <p style={{ fontSize: '24px', fontWeight: 'bold' }}>{dashboardData.pendingPayments || 0}</p>
            </div>
          </div>
        </div>
      ) : (
        <p>No dashboard data available</p>
      )}
    </div>
  );
};

export default Dashboard;
